R["oh__@kevinkib"]="{['na']={[98]={['C']=1.022000,['D']='A private island resort offering luscious cuisine and a tregic magic show to saw the little bitch Bastian in half. Come join me to see the end of Bastian!! ',['N']='Enoshima Lighthouse',['O']=19778,},[69]={['C']=1.037000,['D']='Phedre, the historian is interested in all myths. She recently heard about the ascension of undead and decided to investigate the secret. \\n\\nShe arrived at the Temple of Ascension and was greeted by Clan Mother Tadali. After paying a tribute, she was granted access to the heart of the temple where the Bodhisattva bestowed her blessing and unveiled a sacred portal to the sky burial site. \\n\\nPhedre witnessed the failure of Captain Isara\\'s ascension, which led to Isara\\'s cycle of reincanation again.',['N']='Temple of Ascension',['O']=19924,},[63]={['C']=1.036000,['D']='A slightly modern style winter house for Christmas celebration.',['N']='New Life Snow Globe',['O']=19711,},[103]={['C']=1.041000,['D']='Folktales about an ancient town, Shandora have been told from time to time. \\n\\nCaravans witnessed its appearance in the middle of Alik\\'r Desert and on their journey towards the town, it vanished in a blight of an eye. \\n\\nIf you happen to have a chance to visit Shandora, you may be lucky to grab a bottle of love potion that sells for a handsome sum of golds. ',['N']='The Mirage Town',['O']=19921,},[62]={['C']=1.030000,['D']='Welcome to The Tamriel Grand Museum! ',['N']='Museum of Tamriel',['O']=19778,},[89]={['C']=1.037000,['D']='',['N']='Chapel of Meridia',['O']=19778,},[107]={['C']=1.021000,['D']='An artisan inherited a large property from his late grandfather. It is a large place with 2 houses and he couldn\\'t stand living there alone. \\n\\nHe turned one of the houses into a lakeview inn equipped with a decent restaurant and hot water shower facility. He still persues his beloved hobby - pottery making in his workshop. You are welcome to visit him at his Maple Lakeview Retreat.',['N']='Blackwood Enclave',['O']=19910,},[59]={['C']=1.021000,['D']='',['N']='Alinor House',['O']=19991,},[5]={['C']=1.051000,['D']='Despite the fact that I have never been fond of Dark Elves and Mirri, I decorated a room for Mirri to acknowledge her company and dedication so far. The Sister of Sand inn room is re-skinned in Hlaalu style and hope Mirri finds a peace of mind staying here.  ',['N']='Mirri\\'s Retreat',['O']=20001,},[25]={['C']=1.037000,['D']='A Japanese style shrine to worship the kami Inari and hope to receiving the blessing of household wellbeing and prosperity. ',['N']='Inari (Fox) Shrine',['O']=20004,},[78]={['C']=1.045000,['D']='The Club Andrômeda - an elegant and chic decorated club which offers the best in class quality wines across Tamriel. You can enjoy the alluring pole dance by our beloved reowned dancer Mirri, who learned from the mysterical legend, Lusting Argonian Maid. Who knows if you will be offered something extra by Mirri herself?! ',['N']='Club Andrômeda',['O']=19778,},[111]={['C']=1.021000,['D']='The former owner jumped off the cliff and made this house available to lease. It is fully refurbished with high fences surrounding the cliff to avoid any more tragedy. \\n\\nDespite the unfortune death incident, the prime location (next to a deadly world boss) and the unrivalled stunning scenary definitely worth its value if you are looking for a decent 2 storey property. ',['N']='Showhouse',['O']=19983,},},['TS']=1728405915,['Version']=1773,['Key']='oh__@kevinkib',}"
