R["oh__@whrr"]="{['Version']=1773,['Key']='oh__@whrr',['TS']=1726259770,['na']={[64]={['N']='Cair Paravel',['O']=18409,},[66]={['O']=19759,['D']='just me having fun messing',['N']='Pixie Dust',['C']=1.020000,},[5]={['O']=19030,['D']='Traditional English Manor falls on hard times, and lets rooms out to guests. ',['N']='Inn Room',['C']=1.051000,},[70]={['N']='Cliffside Villa',['O']=18409,},[71]={['O']=19759,['D']='',['N']='Victoria Falls',['C']=1.021000,},[10]={['O']=19064,['D']='Winter, wonderland... As I\\'ve found out that folk don\\'t notice the yard... and well that is my Snowman.... I will say that this house has a backyard and once you are in the yard... you will find if you turn around and look back at the humblemud... it is now a Very large snowman. ',['N']='Snowy Wonder Land',['C']=1.022000,},[11]={['N']='Stormhold House',['O']=18409,},[14]={['O']=19664,['D']='Dorothy\\'s adventures in the land of Oz\\n\\nInspired by  L. Frank Baum\\'s The Wonderful Wizard of Oz',['N']='Dorothy\\'s Adventures',['C']=1.033000,},[15]={['O']=19759,['D']='This is my version of The Shire',['N']='The Shire',['C']=1.021000,},[80]={['O']=19760,['D']='holiday nutcrackers and a volcano!',['N']='Stillwater Hotspring',['C']=1.022000,},[17]={['N']='Home Sweet Home',['O']=18409,},[82]={['O']=19848,['D']='I pulled the house apart and it is all new. I wanted to try and cover the spooky stairs of wood that looked like they would fall out from under you. House has a vineyard and harbor. ',['N']='Mage\\'s Pocket Realm',['C']=1.021000,},[19]={['N']='Christmas Chapel',['O']=18611,},[20]={['O']=18789,['N']='Topaz Gemstone Mine',['C']=1.031000,},[86]={['O']=19760,['D']='',['N']='Whrr\\'s Place',['C']=1.017000,},[87]={['O']=19759,['D']='another tiny inn room',['N']='Inn Room',['C']=1.041000,},[90]={['D']='',['O']=19979,['N']='Krakatoa Villa',['C']=1.021000,},[27]={['N']='Indiana Jones Place',['O']=18508,},[29]={['O']=19047,['D']='',['N']='Entry to the Mine',['C']=1.500000,},[94]={['O']=19146,['D']=