R["oh__@fabresfour"]="{['Version']=1773,['na']={[81]={['C']=1.051000,['D']='At the foot of the Throat of the World, between Western and Eastern Skyrim, a wooden tavern draws the attention of travelers, traders, and hunters alike. Legend has it that, thousands of years ago, Kyne herself descended from the heavens and enchanted the Everlasting Tree, while other people believe the tree was cursed by some playful daedra, or was enchanted by a very powerful wizard. The truth is, no one knows, but this causes completely different people to appear around the tavern.',['O']=19977,['N']='Eversnow Inn',},[18]={['C']=1.051000,['D']='Just the house of my main character, Gwynfour :)',['O']=19957,['N']='Gwynfour\\'s House',},[38]={['C']=1.026000,['D']='This small cave harbor serves as a hideout for three Maormer brothers, the Tide-Cutters, who terrorize the seas of Tamriel.\\r',['O']=19311,['N']='Maormer Port (WIP)',},[71]={['C']=1.021000,['D']='A small farm of a wizard\\r.',['O']=19842,['N']='The Mage\\'s Tower',},[89]={['O']=19957,['N']='Arcane Society',},[90]={['O']=19842,['N']='Portal Hub',},[59]={['O']=19311,['N']='Alinor House',},[79]={['C']=1.038000,['D']='A Vampire Castle',['O']=19286,['N']='Castelo do Vampiro',},[70]={['O']=19288,['N']='Templo de Rimmen',},[62]={['C']=1.020000,['D']='The Arcane Brotherhood is a guild founded by the powerful imperial wizard, Lucius Callinos.\\r\\n\\r\\nThis guild of mages focuses especially on arcane artifacts and the mysteries of magic, and its members split across Tamriel to seek knowledge.\\r\\n\\r\\nThe Guild contains a crafting area, a main study hall, a smaller library, a research room, a communal bedroom, Lucius Callinos\\' bedroom, and the lower hall, which is forbidden to most people (as it is the hall where the Pocket Realm is charged).',['O']=18934,['N']='Arcane Brotherhood',},[15]={['C']=1.026000,['D']='A little sanctuary for Nocturnal.',['O']=19560,['N']='Shrine to Nocturnal',},},['TS']=1726088293,['Key']='oh__@fabresfour',}"
