R["oh__@subl1m1n8"]="{['Version']=1773,['Key']='oh__@subl1m1n8',['na']={[81]={['O']=18732,['N']='New Life Spa Retreat',},[86]={['O']=18992,['N']='Dae Gone Spa Retreat',},[71]={['D']='Welcome to Casa di Bella, training home of the Harem of Dibella. Learn to dance, pray and worship Our Lady to your fullest potential.',['N']='Casa Di Bella',['C']=1.026000,['O']=19251,},[41]={['D']='Welcome to Fern Gully. A magical hidden forest home with mystical and mischieveous creatures. Enjoy a stroll through the gardens, read a book in a tree or take an adventure through the treetops in search of the Sweetroll thief. At the end of the day, unwind in comfort on the private rooftop terrace. Beware though if you venture into the hidden depths, you may come down with a sudden sickness,',['N']='Fern Gully',['C']=1.021000,['O']=19101,},[103]={['D']='Welcome, Weary Traveller, to Haven. Your home away from home. Rest a while, shop for souveniers and feast and drink to your hearts content. If you have some questionable goods in your pocket, we can also take them off your hands, but first... WELL, you\\'ll have to find where ;-)',['C']=1.041000,['N']='Haven Town',['O']=19955,},[59]={['O']=18732,['N']='EnchantedGarden Gala',},[23]={['D']='Welcome to Easy-Pickings. Test your skills as a thief and make your way to the ultimate pile of loot.',['C']=1.041000,['N']='Easy-Pickings',['O']=19295,},[49]={['O']=18732,['N']='Seer\\'s Cottage',},[62]={['O']=18732,['N']='Artaeum Manor',},[47]={['D']='Come bask in the blood red glow of Blood Havest Estate. Home to Vampiric Necromance with a severe dislike of people. All visitors are required to partake in a ritual blood letting ceremony.',['N']='Bloodharvest Estate',['C']=1.017000,['O']=19209,},},['TS']=1724195689,}"
