R["oh__@nebcherwenaton"]="{['eu']={[101]={['C']=1.014000,['N']='SingingBowlStudio',['O']=19652,['D']='Singing Bowl Studio MABIES\\r\\n\\r\\nTired of running from quest to quest?\\r\\nFrustrated by the constant group wipes in raids?\\r\\nWeary of dungeons with strange role distribution?\\r\\nWorn from boss fights?\\r\\nAngry about lousy drop chances for gear and weapons?\\r\\n\\r\\nThen let the stress be gently relieved by our specially imported Singing Bowls.\\r\\nIn collaboration with the Singing Bowl specialist Brave Plate from far away, it is now possible to offer this special relaxation technique in Tamriel.\\r\\n\\r\\nVisti us!',},[38]={['C']=1.013000,['N']='RetirementHome',['O']=19904,['D']='This house will probably never be finished. The basic idea was that you can come home here. A cozy home to feel good, to invite friends, to gamble or to cook together, to do handicrafts, with an outside toilet between the workshop and the house, with a waterworks in the basement. Running water in the house is driven by the windmill and Dwemer constructions. A diving board invites you to take a daring leap into the water, after which you can continue partying.',},[39]={['C']=1.030000,['D']='The Martyrdom Of Tamriel\\r\\nInteractive museum, the first of its kind. Experience the world of agony up close.\\r \\nPurchase exclusive tickets at the main entrance. Explore the entire\\r complex on your own with the help of our museum guides or book a guided tour.\\r Prepare an unusual kind of surprise for your family and friends and book the\\r property for birthday parties, weddings and funerals. For a small surcharge, we\\r carry out professional cremations and include suitable urns.',['O']=19954,['N']='Martyrdom',},},['Version']=1773,['TS']=1724092446,['Key']='oh__@nebcherwenaton',}"
