R["oh__@perfectlyhumble"]="{['Key']='oh__@perfectlyhumble',['na']={[32]={['O']=19152,['C']=1.021000,['D']='Tour the private quarters of the Summer Palace - owned by a wealthy Necromancer craving respite from summers in the city.  This exquisite lakeside estate is filled with custom art & interesting momentos...and boasts a secluded garden off the private patio.',['N']='Summer Palace',},[65]={['O']=19458,['C']=1.500000,['D']='Gone.',['N']='Gone',},[34]={['O']=19140,['C']=1.047000,['D']='Vintage farm c. 1935 Oklahoma\\n(A desire to make a tractor *and* to utilize the sandblown features of this property became a little slice of American history.)\\n<3 Humble',['N']='Dust Bowl',},[37]={['O']=19219,['C']=1.500000,['D']='\"Nostalgia\" A walk through childhood memories of summer - with the hard edges softened by the magic of time.',['N']='Nostalgia',},[70]={['O']=18699,['N']='Moonshadow Glimpses',},[40]={['O']=19785,['C']=1.021000,['D']='\"Winter Haven\" is a lavish estate done in the same sytle as my \"Summer Palace\" at Mournoth.  What began as a simple structure to house a  large, crystal beastie grew into something else entirely.  Built during sunset, but beautiful at any time of day or night.',['N']='WinterHaven',},[41]={['O']=19325,['C']=1.500000,['D']='\"Legacy\"',['N']='Legacy',},[75]={['O']=19279,['C']=1.023000,['D']='Scritch and scry.\\nDoom and devils.',['N']='Alter',},[76]={['O']=19165,['C']=1.029000,['D']='\"Lost Tomb of the Matriarchs\" Four Queens entombed around a stunning oasis.  Victims to both time and greed, the desecrated tombs are now unsealed - ripe for the picking.  Can you find them?  Can you find your way back out?',['N']='Tomb of Matriarchs',},[14]={['O']=19071,['C']=1.021000,['D']='Memorial gardens\\n(Originally listed Feb 2022)',['N']='Memorial Gardens',},[47]={['O']=19071,['C']=1.500000,['D']='Slumber\\n(Please remember to close doors behind you so future visitors can enjoy the journey - thanks!)\\nOriginally listed Jan 2022',['N']='Slumber',},[49]={['O']=19291,['C']=1.021000,['D']='Hag Fen Hilltop Cemetary and Memorial Gardens offers peace and rest....meal plans available for special guests.  Inquire within.  ',['N']='Hilltop Cemetary',},[20]={['O']=19315,['C']=1.025000,['D']='Wyrd Books & Cafe - When your great-great-great-great-grandmother, the eccentric mage, (finally) leaves her beautiful home to you and your cousins, the only thing to do is open up a bookshop and cafe! Right?!  The questionable items in the basement are probably harmless and in no way influenced Nana\\'s longevity.  Probably. (Originally listed 3/21)',['N']='Wyrd Books & Cafe',},[87]={['O']=19071,['C']=1.500000,['D']='Humble\\'s Cut & Curls',['N']='Humble\\'s Cut & Curls',},[88]={['O']=19570,['C']=1.500000,['D']='Insomnia.',['N']='Insomnia',},[25]={['O']=19190,['C']=1.019000,['D']='(Relocated July 2022 - originally complted December 2021)\\nThere\\'s a new piggy in town!',['N']='Fairy Tale',},[27]={['O']=19080,['C']=1.020000,['D']='The Source',['N']='The Source',},[81]={['O']=19071,['C']=1.500000,['D']='Just your average, perfectly normal pumpkin patch.\\n(Originally listed Oct 2021)',['N']='Pumpkin Factory',},[59]={['O']=19071,['C']=1.021000,['D']='Long thought abandoned, some claim to hear odd sounds coming from the once luxurious townhome.  Others say a sweet, floral scent fills the air on warm evenings...a scent not native to the Summerset Isles.  \\n(Originally listed summer 2021)',['N']='Invasive Species',},[17]={['O']=19071,['C']=1.046000,['D']='Contemporary cottage in the country.',['N']='Circle H Cottage',},[95]={['O']=19209,['C']=1.020000,['D']='\"Moonlight\"',['N']='Moonlight',},},['Version']=1773,['TS']=1709445705,}"
