R["fx__na__@fabresfour__89"]="{['Version']=1773,['TS']=1701786234,['Effects']={[1]={['Color']=999998,['Alpha']=1,['Roll']=0,['SizeZ']=11000,['Z']=72933,['Groups']=0,['Y']=22033,['Yaw']=3.316126,['Id']=1225,['SizeY']=11000,['Pitch']=0,['X']=96866,['EffectType']=499,['SizeX']=11000,['Contrast']=1,},[2]={['MetaData']={['message']='Conhecendo a Sociedade Arcana:\\nA Sociedade Arcana é uma guilda criada pelo Mago Imperial Lucius Callinos, um homem íntegro e bastante respeitável que tem como objetivo pesquisar, proteger e criar artefatos mágicos ao redor de Tamriel.\\n\\nComo fazer parte da Sociedade Arcana?\\nSe você quer que seu personagem seja parte da Sociedade Arcana, bem, você está livre! A casa está aberta para todos usarem os seus salões, desde que respeitem regras simples de convivência!\\n\\n1. A casa foi feita para a comunidade Brasileira de RP, então os RP\\'s tendem a acontecer em português. Se você quiser usar a casa para fazer RP\\'s em inglês, sinta-se a vontade, mas não atrapalhe os jogadores que estão fazendo o RP em outra lingua. Se o jogador não se sentir confortável, por exemplo, em digitar em inglês, não exija isso dele.\\n\\n2. Qualquer tipo de ERP é proibido nessa casa.\\n\\n3. RP\\'s privados não existem nessa casa - ela é uma casa aberta, e todos que estão nela podem interagir entre si. Entretanto, é obrigação da pessoa que adentrou a residência respeitar os outros jogadores e não colocá-los em posição de constrangimento. Ninguém é obrigado a fazer RP com ninguém, então respeite as vontades do outro jogador sempre.\\n\\n4. Não atrapalhe o RP dos jogadores - Caso você tenha vindo para essa casa para conhecê-la ou usar as mesas de crafting e algum jogador estiver fazendo RP, não atrapalhe o RP, não fique correndo na volta do jogador ou falando coisas aleatórias no chat.\\n\\nQuebrar uma dessas regras será o suficiente para o banimento permanente da casa.',['title']='A Sociedade Arcana',},['Color']=102439,['Contrast']=1,['Roll']=0,['SizeZ']=30,['Z']=74188.441471,['Groups']=0,['Id']=1233,['SizeX']=26.456456,['X']=97935.052637,['SizeY']=30,['Pitch']=4.712564,['Y']=29871,['EffectType']=8501,['Yaw']=4.712389,['Alpha']=1,},[3]={['MetaData']={['message']='The Arcane Society is a guild created by the Imperial Mage Lucius Callinos, an upstanding and highly respectable man who aims to research, protect and create magical artifacts around Tamriel.\\n\\nHow to be part of the Arcane Society?\\n\\nIf you want your character to be part of the Arcane Society, well, you\\'re free! The house is open for everyone to use its lounges, as long as they respect simple rules of coexistence!\\n\\n1. The house was made for the Brazilian RP community, so RP tend to be written in Portuguese. If you want to use the house to do RP\\'s in English, feel free, but don\\'t disturb the players who are doing RP in another language. If the player is not comfortable with, for example, typing in English, then do not demand this from him.\\n\\n2. Any type of ERP is prohibited in this house.\\n\\n3. Private RP\\'s don\\'t exist in this house - it\\'s an open house, and everyone in it can interact with each other. However, it is the obligation of the person who entered the residence to respect the other players and not put them in a position of embarrassment. No one is obligated to do PR with anyone, so respect the other player\\'s wishes at all times.\\n\\n4. Don\\'t disturb the players\\' RP - If you came to this house to explore it or use the crafting tables and some player is doing RP, don\\'t disturb the RP, don\\'t run around the player or say random things in the chat.\\n\\nBreaking one of these rules will be enough for a permanent ban from the house.',['title']='The Arcane Society',},['Color']=102439,['Contrast']=1,['Roll']=0,['SizeZ']=30,['Z']=74291.594034,['Groups']=0,['Id']=1234,['SizeX']=26.456456,['X']=97910.377274,['SizeY']=30,['Pitch']=4.799655,['Y']=29867,['EffectType']=8501,['Yaw']=4.276057,['Alpha']=1,},[4]={['MetaData']={['message']='Leia as regras na entrada! / Read the rules at the entrance',['name']='A Sociedade Arcana',},['Color']=696969,['Contrast']=1,['Roll']=0,['SizeZ']=235,['Z']=74042.209411,['Groups']=0,['Id']=1235,['SizeX']=90,['X']=97693.056390,['SizeY']=235,['Pitch']=0,['Y']=29929,['EffectType']=5010,['Yaw']=4.712389,['Alpha']=0,},[5]={['MetaData']={['message']='A Sociedade Arcana é dividida entre diversos cargos e funções principais, e seus membros devem levar seu trabalho sempre com excelência, nunca aceitando falhas ou trabalhos tortos. Se um membro da guilda falha, é o suficiente para um objeto causar um terrível caos em Tamriel.\\n\\nArquinista - O mais alto cargo da guilda, um Arquinista é o mago especializado no estudo das Artes Arcanas de Tamriel e é um estágio alcançado apenas pelos mais apaixonados pelo estudo da magia de Nirn. Exige-se desses magos um conhecimento geral nas diversas áreas, mas aprofundamento especial em uma área principal de conhecimento. Atualmente o cargo é ocupado por Lucius Callino, especialista em Misticismo e  Edgaan Gaaseric, especialista em Restauração. Um Arquinista recebe o total de +3 numa única perícia mágica à sua escolha.\\n\\n\\nAlto-Conselheiro - O segundo cargo mais alto da guilda, normalmente é dedicado aos membros de nível igual ao Arquinista. Os Alto conselheiros recebem um total de +3 em uma perícia única à sua escolha.\\n\\nMestre Arcano - O terceiro cargo mais alto da guilda, normalmente é dedicado aos mestres dos Preceptores. Esse cargo é destinado aos estudiosos mais dedicados e inteligentes, que estejam a frente das buscas dos artefatos poderosos de Nirn, são os pesquisadores de campo que tendem a contratar equipes e levar estudantes na busca das relíquias espalhadas pelo continente. Exige-se de um Mestre Arcano quase todas as mesmas competências de um Arquinista. Um Mestre Arcano recebe um bônus de +2 em uma única perícia mágica à sua escolha.\\n',['title']='Cargos da Guilda - Parte 1',},['Color']=102439,['Contrast']=0.750000,['Roll']=0,['SizeZ']=36,['Z']=73378,['Groups']=0,['Id']=1236,['SizeX']=29.456456,['X']=96766,['SizeY']=36,['Pitch']=1.570971,['Y']=21639,['EffectType']=8501,['Yaw']=2.268928,['Alpha']=1,},[6]={['MetaData']={['message']='Preceptor - responsáveis pela educação e conhecimento exotérico aos Oficiais, Arcanistas, Correligionário, Aprendizes e Associados. Esses membros tendem a levar seus alunos a campo em missões mais simples que os ajudem a entender a complexidade do trabalho Arcano. Além disso, os Preceptores são responsáveis por ensino de magia das mais diversas escolas. Um membro Preceptor deve ter especialização em uma área específica da magia para ensinar os seus alunos, como Destruição ou Alteração. Um Preceptor recebe um bônus de +2 em uma única perícia mágica à sua escolha.\\n\\nArcanista - Quando um aprendiz atinge suas capacidades médias e está apto a exercer sua função sem depender da guia de um Preceptor, ele se torna um Arcanista. Desses membros é exigido competência e excelência, além de pró-atividade em realizar tarefas pessoais que os tornem dignos de subir de cargo. Entretanto, é muito difícil deixar o cargo de Arcanista, pois ele representa o cargo de um membro em suas plenas capacidades. Um Arcanista formado pela guilda recebe um bônus de +1 em uma única perícia mágica à sua escolha. \\n\\nOficial - Cargo mais alto que um membro não-mago pode atingir na Sociedade Arcana, os Oficiais são responsáveis pela guarda e patrulha da guilda, além de trabalharem como escolta dos magos em missões de busca e apreensão de artefatos. Um oficial deve ter alguma habilidade física de destaque, como destreza ou força, deve ser centrado, competente e honroso para com o seu dever. Os Oficiais ficam responsáveis pela organização e distribuição dos Correligionários. Um Oficial recebe +2 em testes de Força ou Destreza.',['title']='Cargos da Guilda - Parte 2',},['Color']=102439,['Contrast']=0.750000,['Roll']=0,['SizeZ']=36,['Z']=73308.006619,['Groups']=0,['Id']=1238,['SizeX']=29.456456,['X']=96660.639065,['SizeY']=36,['Pitch']=1.570971,['Y']=21639,['EffectType']=8501,['Yaw']=3.490659,['Alpha']=1,},[7]={['MetaData']={['message']='Correligionário - O segundo cargo que um membro não-mago pode atingir dentro da guilda. Esses membros recebem ordens diretas dos Oficias e tendem a trabalhar perto deles como seguidores fiéis. Exige-se experiência com armas físicas ou de distância e competência desses membros. Um Correligionário recebe +1 em testes de Força ou Destreza.\\n\\nAprendizes - O primeiro cargo de um membro que deseja aprimorar suas habilidades arcanas. Todos os aprendizes devem responder aos Preceptores, e respeitar os Arcanistas. Devem comparecer a aulas e a jornadas de exploração para conhecer mais sobre suas atividades e aprimorar suas competências. Exige-se, acima de tudo, responsabilidade e respeito dos membros aprendizes.\\n\\nAssociados - Aqueles que tem interesse em ajudar a Sociedade Arcana, devem fazer missões ao lado de Preceptores para serem avaliados. O período de avaliação de um Associado é individual e pode variar de acordo com as capacidades que o Associado demonstra. Um Associado por ascender rapidamente para o cargo de Arcanista ou Correligionário dependendo do nível de conhecimento e postura apresentados.',['title']='Cargos da Guilda - Parte 3',},['Color']=102439,['Contrast']=0.750000,['Roll']=0,['SizeZ']=36,['Z']=73283.103716,['Groups']=0,['Id']=1239,['SizeX']=29.456456,['X']=96555.854307,['SizeY']=36,['Pitch']=1.570971,['Y']=21639,['EffectType']=8501,['Yaw']=2.879793,['Alpha']=1,},[8]={['Color']=494949,['Alpha']=1,['Roll']=0,['SizeZ']=100,['Z']=58872,['Groups']=0,['Y']=23187,['Yaw']=3.141593,['Id']=1244,['SizeY']=220,['Pitch']=5.672320,['X']=94856,['EffectType']=926,['SizeX']=220,['Contrast']=1,},[9]={['Color']=494949,['Alpha']=1,['Roll']=0,['SizeZ']=100,['Z']=59775,['Groups']=0,['Y']=23176,['Yaw']=1.570796,['Id']=1245,['SizeY']=220,['Pitch']=0,['X']=94762,['EffectType']=926,['SizeX']=220,['Contrast']=1,},[10]={['