R["fx__na__@fabresfour__62"]="{['Effects']={[1]={['Y']=6940,['MetaData']={['message']='During the Planemeld, one of the Mages Guild\\'s most experienced arcanists, Lucius Callinos, founded a secret society for the study of magical artifacts.\\n\\nOver the years, his guild became very recognized, and the psijic themselves offered a deal.\\n\\nThe Arcane Brotherhood was taken to a pocket realm, and there, the mages guarded some of the most dangerous and powerful artifacts Tamriel could offer, far from the hands of the ambitious men and mer fighting for the conquest of the continent.\\n\\n\\n\\n\\n\\n\\n\\nDurante a Fusão Planar, um dos arcanistas mais experientes da Guilda dos Magos, Lucius Callinos, fundou uma sociedade secreta de estudo de artefatos mágicos.\\n\\n\\n\\nCom o decorrer dos anos, a guilda dele se tornou muito reconhecida, e os próprios Psíjicos ofereceram um acordo.\\n\\n\\n\\nA Sociedade Arcana foi levada para um plano de bolso, e lá, os magos guardavam alguns dos artefatos mais perigosos e poderosos que Tamriel poderia oferecer, longe das mãos dos homens e mer ambiciosos que lutam pela conquista do continente. ',['title']='The Arcane Brotherhood',},['EffectType']=8503,['Roll']=0,['Alpha']=1,['Groups']=0,['Pitch']=1.570971,['Contrast']=0.900000,['SizeY']=30,['SizeZ']=30,['X']=70242,['Color']=481711,['Id']=1048,['Z']=65524,['Yaw']=1.570796,['SizeX']=26.456456,},[2]={['EffectType']=4559,['Y']=12180,['Roll']=0,['Alpha']=0.940000,['Yaw']=2.705260,['Pitch']=0,['Groups']=0,['SizeY']=600,['Contrast']=1,['X']=75760.982520,['Color']=995046,['Id']=1164,['Z']=68401.967625,['SizeZ']=600,['SizeX']=600,},[3]={['EffectType']=525,['Y']=7336,['Contrast']=1,['Alpha']=1,['SizeX']=1000,['Pitch']=0,['Roll']=0,['SizeZ']=1000,['SizeY']=1000,['X']=63536,['Color']=997900,['Id']=1165,['Z']=68779,['Yaw']=1.570796,['Groups']=0,},[4]={['EffectType']=525,['Y']=7336,['Contrast']=1,['Alpha']=1,['SizeX']=1000,['Pitch']=0,['Roll']=0,['SizeZ']=1000,['SizeY']=1000,['X']=62173,['Color']=