n that I wake up with crazy ideas, motivated and enthusiastic to create new things - things that I hope you find helpful or fun (or both) - every single morning.\\n\\nThank you for these opportunities. Thank you for restoring my passion in game development. Thank you for being there for me, for letting me be there for you, and - most importantly - for being there for each other.\\n\\nI say this often, but I will say it again: this Community is, far and away, the most kind, genuine and caring group of people that I have ever had the honor of being a member of. Most of all, thank you for that.\\n\\nI wish you all a safe and joyous holiday this year and I look forward to celebrating many more with you in the years to come.\\n\\nLove,\\nCardinal',['title']='Fortitude From Solitude',},['Id']=61296,['Groups']=0,['Y']=27162,['Alpha']=1,['Roll']=0,['SizeY']=40,['Color']=56899,['EffectType']=8503,['Z']=101237,['X']=123451,['Pitch']=5.497787,['SizeZ']=40,},[5]={['Alpha']=1,['Groups']=0,['Contrast']=1,['Id']=61297,['X']=116097,['Y']=27110,['SizeX']=1600,['Roll']=0,['SizeY']=1600,['Color']=292929,['EffectType']=906,['Z']=102858,['Yaw']=4.869469,['Pitch']=0,['SizeZ']=1600,},[6]={['Alpha']=1,['Groups']=0,['Contrast']=1,['Id']=61298,['X']=115916,['Y']=27099,['SizeX']=1402,['Roll']=0,['SizeY']=1402,['Color']=0,['EffectType']=945,['Z']=102888,['Yaw']=4.897394,['Pitch']=0,['SizeZ']=1402,},[7]={['Alpha']=1,['Groups']=0,['Contrast']=1,['Id']=61299,['X']=107642,['Y']=19548,['SizeX']=9000,['Roll']=0,['SizeY']=9000,['Color']=0,['EffectType']=945,['Z']=105585,['Yaw']=5.092871,['Pitch']=0,['SizeZ']=9000,},[8]={['Alpha']=1,['Groups']=0,['Contrast']=1,['Id']=61300,['X']=108007,['Y']=19548,['SizeX']=11200,['Roll']=0,['SizeY']=11200,['Color']=90909,['EffectType']=906,['Z']=105432,['Yaw']=5.134759,['Pitch']=0,['SizeZ']=11200,},[9]={['Alpha']=1,['Groups']=0,['Contrast']=2,['Id']=61301,['X']=123740,['Y']=30260,['SizeX']=1700,['Roll']=0,['SizeY']=1300,['Color']=367299,['EffectType']=991,['Z']=10022