R["fx__na__@sinister_biscuit__29"]="{['TS']=1638537021,['Effects']={[1]={['Alpha']=1,['Y']=20148,['SizeX']=26.456456,['SizeY']=30,['Color']=48,['Contrast']=1.400000,['SizeZ']=30,['MetaData']={['title']='Skeleton Puns and Jokes',['message']='What\\'s a skeleton\\'s prefered food? \\nBone Meal!\\n.\\nWhat do you call it when a skeleton is having a great time? \\nAn osteoblast!\\n.\\nWhat\\'s a skeleton\\'s prefered instrument? \\nThe trom-BONE!\\n.\\nHow did the skeleton know it was going to rain? \\nHe could feel it in his bones!\\n.\\nWhat\\'s a skeleton\\'s favorite plant? \\nA BONE-zai tree!\\n.\\nHow does a skeleton get their mail? \\nThe bony-express!\\n.\\nWhy does a skeleton start a fight?\\nBecause he has a bone to pick!\\n.\\nWhat does a skeleton say before he begins to eat?\\nBone appetit!\\n.\\nHow do you make a skeleton laugh? \\nWhen you tickle his funny bone!',},['Z']=25555.056784,['Roll']=0,['X']=25638.233121,['Id']=1029,['Yaw']=1.890192,['Groups']=0,['Pitch']=4.712564,['EffectType']=8502,},[2]={['Alpha']=1,['Y']=20130,['SizeX']=26.456456,['SizeY']=30,['Color']=126099,['Contrast']=1.900000,['SizeZ']=30,['MetaData']={['title']='Abuela\\'s Crazy Cookies',['message']='This is my grandmother\\'s unusual cookie recipe. Many things can be added, left out, or replaced according to tastes but this is the recipe I have written.\\n\\n1 cup butter (room temp)\\n1 cup brown sugar\\n1 1/2 cup white sugar\\n1 tbsp milk\\n1 1/2 tsp vanilla\\n2 eggs\\n1 cup fresh corn flakes\\n3 cups oatmeal\\n\\n1 1/2 cups flour\\n1 1/4 baking soda\\n1 tsp salt\\n1/2 mace\\n1 1/2tsp cinnamon\\n1/4 tsp nutmeg\\n1/8 tsp powered cloves\\n4oz shredded coconut\\n2 cups chocolate chips\\n1 cup nuts\\n\\n\\nPreheat oven to 350*F (176*C)\\n\\nCream together butter and sugars until smooth. Add milk and vanilla together with eggs and beat into butter/sugar mixture until mixed. Stir in corn flakes and oatmeal. Stir in coconut, chocolate chips, and nuts.\\n\\nIn Seperate bowl sift flour, baking soda, salt, and spices together until mixed. Carefully mix into (sugar/egg) batter. Batter will be stiff.\\n\\nUse teaspoon to measure batter into balls (palm sized) and drop onto pre-greased cookie sheet. \\n\\nBake 10 minutes at 350*F degrees (may vary) \\nYields approx. 4 to 8 dozen. \\n(refrigerate or freeze leftover cookie dough for later use!)',},['Z']=26230.305339,['Roll']=0,['X']=24794.921576,['Id']=1030,['Yaw']=2.759366,['Groups']=0,['Pitch']=4.712564,['EffectType']=8502,},[3]={['Alpha']=1,['Y']=20968,['SizeX']=26.456456,['SizeY']=30,['Color']=1199,['Contrast']=0.580000,['SizeZ']=30,['MetaData']={['title']='Unusual Tales Vol. 1',['message']='(pre-warning : this short story may be considered horror/spooky themed.)\\n\\nIf we dream, do those dreams become real somewhere else? This was the question that floated through Max\\'s mind as he stared up at the clouds above. Perhaps it was a stupid thought but he liked these lazy afternoons where he let such thought out to flutter free without hesitation. A whistle from down the hill pulled his silly thoughts down from the sky and he sat up to find the source. Robin came running up the hill, out of breath and stained with the soot from working in the mines. Panting, he gestured and wheezed, \"Abbot Frine was looking for you.\"\\n\\nMax sighed. Of course the Abbot was looking for him. The abbot was ALWAYS looking for him. Being the oldest mage within the town had both it\\'s advantages and disadvantages all within the same hand. It was this obnoxious curse that made the abbot constantly call for Max as if he was the ONLY mage within the village.  \\n\\nStanding, he waved to his freshly abandoned lay-spot within the sweet grass. \"Take a breather.\"\\n\\nRobin gave a grateful grin, his round boyish cheeks bunching near his eyes as he flopped down gratefully and Max headed down the hill. It didn\\'t take long to reach the large spiraling building that housed the abbot and the monks of the silent order. Max sometimes took the time to wonder on the purpose of the silent monks while he lounged on this hill but since no one knew and they were not allowed the words to explain themselves, much of his wondering was left unanswered.\\n\\nHis knuckles rapped on the doorway, a solid staccato that echoed along the stone thanks to his gauntlet. \"Abbot Frine? It\\'s Maxhumine.\"\\n\\nSilence. \\n\\n(continued in Vol 2)',},['Z']=26033.132116,['Roll']=0,['X']=25429.656638,['Id']=1031,['Yaw']=3.553490,['Groups']=0,['Pitch']=4.694936,['EffectType']=8503,},[4]={['Alpha']=1,['Y']=20968,['SizeX']=26.456456,['SizeY']=30,['Color']=1199,['Contrast']=0.580000,['SizeZ']=30,['MetaData']={['title']='Unusual Tales Vol. 2',['message']='(cont.)\\n\\nThe priory was always a creepy quiet due to the lack of voices but today he could not hear even the daily chores or one of the monks playing one of their little dulcimers to drive away the bad spirits that sometimes lingered in too-silent spaces. Stepping into the abbot\\'s room, Max realized that something was horribly, terribly, desperately wrong. The room looked as if someone had melted a wax painting. The chair sagged in a horrible and wrong way-- the wood warped into something that made the memory of the tree it was birthed from scream. The stones had pooled and run together-- no longer a swirling and artful cobblestone. \\n\\nMax crossed himself as he said a small prayer and then pulled off his gauntlets to allow him to magically \\'feel\\' the room. Whatever magic had been used here had tainted this room. It felt sour and tasted twisted. It was as if the fundamental nature of the room had been changed and now he was experiencing the lingering result. Then what must have been the cause caught his eye and stopped the breath in his throat. Open on the desk was the most lovely novel bound in pristine white. It gave a faint glow that radiated power and he stretched a hesitant hand out only to stop short when he realized that another hand was touching the open book. That hand was made of a mixture of materials. They sprouted at random like a child\\'s odd attempt at decorating a sand castle or a very horrific attempt at a golem made of scrap. Yet altogether those random pieces formed the figure of what Max was quickly suspecting to be the remains of the abbot. \\n\\n(continued in vol 3)',},['Z']=26069.293999,['Roll']=0,['X']=25412.559321,['Id']=1032,['Yaw']=4.077089,['Groups']=0,['Pitch']=4.694936,['EffectType']=8503,},[5]={['Alpha']=1,['Y']=20968,['SizeX']=26.456456,['SizeY']=30,['Color']=1199,['Contrast']=0.580000,['SizeZ']=30,['MetaData']={['title']='Unusual Tales Vol. 3',['message']='(cont.)\\n\\nFear is a daily occurrence for hand mages like Max but today he began to experience a fear unlike anything he\\'d ever dreamed. Backing out of the room he rapidly drew runes of protection in the air and then sealed the door with the most powerful spell he knew. The handprints his barrier left on the door were like seared sea-flowers on the once beautifully carved wood. \\n\\nWood... that had scratches.\\n\\nThe silence, unnatural and pressing, itched like a worry in the back of his mind as he touched a finger to the scratches and tried to spell out the cause. His fears became rather forefront when he realized that he didn\\'t need to cast a spell to find the source when it was standing quite near him. At the end of the hall was a creature. It\\'s great eyes aglow and it\\'s tail held high above its head. The beast had no mouth but he knew it was grinning like a jackal about to laugh.\\n\\n(continued in Vol. 4)',},['Z']=26085.721443,['Roll']=0,['X']=25372.329832,['Id']=1033,['Yaw']=3.553490,['Groups']=0,['Pitch']=4.694936,['EffectType']=8503,},[6]={['Alpha']=1,['Y']=20968,['SizeX']=26.456456,['SizeY']=30,['Color']=1199,['Contrast']=0.580000,['SizeZ']=30,['MetaData']={['title']='Unusual Tales Vol. 4',['message']='(cont.)\\n\\nIt was then that the silence shattered.\\n\\nThere was no sounds quite like the ones Max could hear now. Perhaps if you made a cow laugh as cats fought in the background and bells hummed in high notes it might be close to the sounds that crashed like shattering vases around him. Frozen in fear Max didn\\'t think to move until it was too late and the beast\\'s tail wrapped around his waist. As if it was little more than a passing thought, the beast simply melded through the wall to avoid the ward around the doorway that he\\'d placed. \\n\\nPassing through the wall was like passing through a vat of jelloed brick and Max scrabbled blindly casting spells as quickly as his hands could flutter-- and when nothing seemed to work he simply tried to grip the stones. It was as he was dragged to the book that he realized why the cobblestones looks like they had been melded together so oddly. Every time he tried to grip the floor his hands passed through and twisted the mixture of reality just a little more. Every line in the floor was a mark from someone being dragged... but to where?\\n\\nA sucking sound behind him drew his attention. Twisting in the monster\\'s grasp he stared in horror at the book as the creature eased into it like an old man easing into a warm bath. The only thing he could do as he was pulled into the book was to magically sign out a final warning to the town and set a ward upon the priory so that none could enter. \\n\\nFar up on the hill Robin felt a chill as a tolling bell began to sound in great haunting strokes. \\n\\nFlee. Run. The words echoed in every mind as the bell tolled endlessly.\\n\\n(This story is dedicated to my spouse who married me for some reason one lovely halloween day. Happy eleventh anniversary my dear! <3 )\\n',},['Z']=26113.565173,['Roll']=0,['X']=25352.588334,['Id']=1034,['Yaw']=4.251622,['Groups']=0,['Pitch']=4.694936,['EffectType']=8503,},},['Version']=1767,}"
