R["oh__@na'tiiri"]="{['na']={[71]={['N']='Elsweyr Meadow',['O']=18914,['C']=1.021000,['D']='Dawn breaks as our Garden opens for Business! The Botanical Wonders Garden of Tamriel is opening its doors to all of Nirn! Come one come all and see the grand gardens set out for all to behold! From bog gardens to Alinor Maples even the Craglorn Apple blossoms are here for the show! Take a stroll through the wonderland of gardens and appreciate what civilization has given us! ',},[61]={['N']='The Den',['O']=18919,['C']=1.021000,['D']='Welcome to the Den! Come check out this magnificent tree specimen with a House built right in! It\\'s growing out of a giant volcanic cave in Hircine\\'s Realm. Be sure to check out the swimming pool with towels provided and the observation platform viewing the spectacular Hircine\\'s moon!',},},['Version']=1764,['TS']=1634684968,['Key']='oh__@na\\'tiiri',}"
