R["fx__na__@sinister_biscuit__44"]="{['TS']=1638537033,['Effects']={[1]={['Alpha']=1,['Y']=12385,['X']=39457.877905,['Groups']=0,['Color']=333998,['Contrast']=0.560000,['SizeZ']=50,['SizeY']=50,['Z']=81846.742996,['Roll']=0,['MetaData']={['title']='Diary of an Unknown Scholar',['message']='In the farthest northern part of Vvardenfell is a windmill-lighthouse build within the old shell of an unnamed creature. This is Safe Haven, the home of two lovers who dedicated their lives to freeing the slaves on the island. While the original caretakers may no longer apear to be there, the magic lives on as if the very home itself is alive. Some even say they could hear the old house breathing when they entered, though the sound was almost comforting along with the soft music that can be heard tinkling through the walls. Outside the garden is still tended. Soft circles are gently raked and maintained in the sand as tea is offered nearby to all those seeking safety. No one has seen who makes the tea or tends to the aformentioned garden.\\n\\nWhile you visit you are free to wander as you please. Within the home you can find a large kitchen where food can be found, a bathroom to wash away the dust of your travels, a library that offers knowledge-- both forbidden and mundane-- and a warm fire where all who enter may relax before continuing their journey. \\n\\nThis magical house is, for the most part, a beacon of hope and safety. The house provides for its visitors and inspires feelings of peace in all-- except slavers. It is rumored that those few who enter with ill intentions will see the sinister red windows of the house narrow ever so slightly and they\\'ll see no other visitors within the home. They also say that the breathing within its walls is no longer benevolent. Lastly, it is said that the floors will shift for such visitors, revealing a passage downwards that none can resist taking-- never to be seen again. \\n\\nAll that, however, is just speculation and rumor...right? Besides-- if your intentions are pure there is nothing to fear.',},['Id']=1010,['Yaw']=0.651008,['Pitch']=4.687954,['SizeX']=26.456456,['EffectType']=8502,},[2]={['Y']=1,['Color']=616699,['Alpha']=0.750000,['SizeX']=150000,['Contrast']=3.940000,['SizeZ']=150000,['Groups']=0,['Z']=80960,['Roll']=0,['X']=39980,['Id']=1016,['Yaw']=0,['SizeY']=150000,['Pitch']=0,['EffectType']=13,},[3]={['Y']=13366,['Color']=605199,['Alpha']=1,['SizeX']=50000,['Contrast']=1.440000,['SizeZ']=2000,['Groups']=0,['Z']=82454.689617,['Roll']=0,['X']=40169.345201,['Id']=1019,['Yaw']=4.944518,['SizeY']=2000,['Pitch']=0,['EffectType']=895,},[4]={['Y']=12805,['Color']=997900,['Alpha']=1,['SizeX']=1000,['Contrast']=3.060000,['SizeZ']=1360,['Groups']=0,['Z']=81233.595228,['Roll']=0,['X']=41600.935313,['Id']=1020,['Yaw']=4.742060,['SizeY']=1360,['Pitch']=0,['EffectType']=525,},[5]={['Y']=13659,['Color']=383899,['Alpha']=1,['SizeX']=50000,['Contrast']=1.820000,['SizeZ']=2000,['Groups']=0,['Z']=80238.233049,['Roll']=0,['X']=42032.262153,['Id']=1021,['Yaw']=4.864233,['SizeY']=2000,['Pitch']=0,['EffectType']=895,},[6]={['Y']=13724,['Color']=101899,['Alpha']=1,['SizeX']=50000,['Contrast']=1.620000,['SizeZ']=2000,['Groups']=0,['Z']=81007.574467,['Roll']=0,['X']=38240.570190,['Id']=1022,['Yaw']=0.638791,['SizeY']=2000,['Pitch']=0,['EffectType']=895,},[7]={['Y']=13019,['Color']=997900,['Alpha']=1,['SizeX']=1760,['Contrast']=1,['SizeZ']=1880,['Groups']=0,['Z']=80209.683967,['Roll']=0,['X']=40063.945120,['Id']=1023,['Yaw']=3.813544,['SizeY']=1880,['Pitch']=0,['EffectType']=525,},[8]={['Y']=13042,['Color']=997900,['Alpha']=1,['SizeX']=1100,['Contrast']=1.700000,['SizeZ']=1500,['Groups']=0,['Z']=79726.418096,['Roll']=0,['X']=40856.991658,['Id']=1024,['Yaw']=4.722861,['SizeY']=1500,['Pitch']=0,['EffectType']=525,},},['Version']=1767,}"
