in the bones.\\n...\\nI found another Watcher, I do wonder if this one was sent from Uncle Sheo, it keeps rearranging the books, yesterday it was turning them around so their spines face the wrong way, fortunately the other one seems to be trying to fix the mess.\\n...\\nToday I found a Dragon Claw, there are three symbols on the underside, a bear, a snake, and an owl, what could it mean I wonder?\\n...\\nThe guard and the maid have gone to Solitude to pick up some provisions, let\\'s hope they don\\'t come back drunk this time, if she didn\\'t bake such delicious cakes I\\'d fire the sot, she claims the contraption she uses to mix the cake batter was a gift from a daedric prince. The design is intriguing, it reminds me of a child\\'s spinning top, you push the plunger and the blades spin and spin and spin, it makes my mouth water just thinking about it, maybe a glass of wine will satiate my appetite.\\n...\\nI still can\\'t get that stupid dwarven puzzle box open, I\\'ll head to Markarth to see if I can glean anything there, though I suspect I\\'d have better luck in Winterhold.\\n...\\nThere seems to be magicka escaping from the area near the standing stones out by the lake, a woman from Solitude has come to look as she thinks there could be an antiquity buried there, I think she\\'s wrong it looks different, but I\\'ve given her permission to dig, maybe she\\'ll find more bones for me.',['title']='Journal',},['Groups']=0,['Alpha']=1,['Y']=21551,['SizeY']=30,['EffectType']=8501,['SizeX']=26.456456,['SizeZ']=30,['Id']=2070,['X']=163783,['Color']=998251,['Yaw']=2.548181,['Contrast']=1,['Roll']=0,},[2]={['Pitch']=6.108652,['Z']=156182,['MetaData']={['message']='Moo!',},['Groups']=0,['Alpha']=1,['Y']=20314,['SizeY']=22,['EffectType']=4403,['SizeX']=40,['SizeZ']=22,['Id']=2071,['X']=164671,['Color']=469899,['Yaw']=5.759587,['Contrast']=1,['Roll']=0,},[3]={['Y']=28000,['Z']=162278,['SizeY']=800,['Alpha']=1,['Pitch']=0,['Groups']=0,['EffectType']=968,['SizeX']=800,['Size